Object(h.a)(JSON.parse('{"ar":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"لكي تقوم باستيراد كمية هائلة من النواتج مرة واحدة، أو لتحديث النواتج الحالية، برجاء *اتباع تنسيق CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"الأهم من ذلك، يتيح لك Canvas إضافة النواتج إلى معايير التقييم بحيث يمكنك تقييم الإجادة بينما تقوم بتقييم المهام. بمجرد أن تقوم بإعداد النواتج، انقر فوق إدارة المعايير للبدء في استخدام النواتج الخاصة بالتقييم.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"إعداد النتائج"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"يتم إنشاء النواتج هنا لتتبع الإجادة في أي مساق. لبدء العمل، افحص شريط القائمة على طول الجزء العلوي. انقر فوق زر ناتج جديد لإنشاء ناتج جديدة، أو زر مجموعة جديدة لإنشاء مجموعة جديدة لتنظيم النواتج فيها. سيتيح لك الزر \\"بحث\\" استخدام النواتج التي تم إنشاؤها بواسطة الولاية أو المؤسسة. بينما تقوم بإنشاء واستخدام النواتج، سيكون بإمكانك استخدام اللوحة الموجودة إلى اليسار للتنقل عبر النواتج الخاصة بك. يمكنك سحب وإفلات النواتج بين المستويات المختلفة لإنشاء البنية."},"cy":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"I fewngludo nifer fawr o Ddeilliannau ar yr un pryd, neu i ddiweddaru’ch deilliannau presennol,  *dilynwch fformat y CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Yn bwysicach fyth, mae Canvas yn gadael i chi ychwanegu deilliannau i’ch cyfarwyddiadau graddio er mwyn i chi allu gwerthuso lefel meistroli wrth i chi roi gradd i aseiniadau. Ar ôl i chi osod deilliannau, cliciwch Rheoli Cyfarwyddyd Sgorio i gychwyn defnyddio eich deilliannau ar gyfer graddio.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Gosod Deilliannau"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Mae deilliannau’n cael eu creu yma i ddilyn lefel meistroli mewn cwrs. I gychwyn arni, ewch i’r bar dewislenni ar hyd y rhan uchaf. Cliciwch y botwm Deilliant Newydd i greu deilliant newydd, neu\'r botwm Grŵp Newydd i greu grŵp newydd i’w ddefnyddio i roi trefn ar eich deilliannau. Bydd y botwm Canfod yn gadael i chi ddefnyddio deilliannau sydd wedi\'u creu gan eich talaith neu sefydliad. Wrth i chi greu a defnyddio deilliannau, byddwch yn gallu defnyddio\'r panel ar y chwith i lywio drwy eich deilliannau. Gallwch chi lusgo a gollwng deilliannau rhwng y gwahanol lefelau i greu strwythur."},"da":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"For at importere et stort antal læringsudbytter på én gang, eller for at opdatere dine eksisterende læringsudbytter, bedes du *følge CSV-formatet*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Endnu vigtigere kan Canvas give dig mulighed for at tilføje læringsudbytter til dine karakterrubrikker, så du kan evaluere opfyldelse af læringsmål, mens du giver opgaver karakterer. Når du har oprettet læringsudbytter, skal du klikke på Administrer rubrikker for at begynde at bruge dine læringsudbytter til karaktergivning.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Konfiguration af læringsudbytte"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Læringsudbytter oprettes her for at spore opfyldelse af læringsmål i et fag. For at komme i gang skal du tjekke menulinjen for oven. Klik på knappen Nyt læringsudbytte for at oprette et nyt læringsudbytte eller på knappen Ny gruppe for at oprette en ny gruppe for at organisere dine læringsudbytter. Find-knappen giver dig mulighed for at bruge læringsudbytter, der er oprettet af din stat eller institution. Når du opretter og bruger læringsudbytter, kan du bruge panelet til venstre for at navigere gennem dem. Du kan trække og slippe læringsudbytter mellem de forskellige niveauer for at oprette struktur."},"da-x-k12":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"For at importere et stort antal læringsudbytter på én gang, eller for at opdatere dine eksisterende læringsudbytter, bedes du *følge CSV-formatet*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Endnu vigtigere kan Canvas give dig mulighed for at tilføje læringsudbytter til dine vurderingskriterier, så du kan evaluere opfyldelse af læringsmål, mens du vurderer opgaver. Når du har oprettet læringsudbytter, skal du klikke på Administrer vurderingskriterier for at begynde at bruge dine læringsudbytter til vurdering.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Konfiguration af læringsudbytte"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Læringsudbytter oprettes her for at spore opfyldelse af læringsmål i et fag. For at komme i gang skal du tjekke menulinjen for oven. Klik på knappen Nyt læringsudbytte for at oprette et nyt læringsudbytte eller på knappen Ny gruppe for at oprette en ny gruppe for at organisere dine læringsudbytter. Find-knappen giver dig mulighed for at bruge læringsudbytter, der er oprettet af din stat eller institution. Når du opretter og bruger læringsudbytter, kan du bruge panelet til venstre for at navigere gennem dem. Du kan trække og slippe læringsudbytter mellem de forskellige niveauer for at oprette struktur."},"de":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Um eine größere Zahl Ergebnisse auf einmal zu importieren oder Ihre vorhandenen Ergebnisse zu aktualisieren, folgen Sie bitte *dem CSV-Format*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Was noch wichtiger ist: Mit Canvas können Sie Ergebnisse zu Ihren Bewertungsschemata hinzufügen, sodass Sie Ihr Leistungsziel einschätzen können während Sie Aufgaben lösen. Sobald Sie Ergebnisse erreicht haben, klicken Sie auf „Bewertungsschemata verwalten“, um ihre Ergebnisse in die Benotung einfließen zu lassen.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Lernziele einrichten"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Die Ergebnisse werden hier erzielt, um das Leistungsziel in einem Kurs zu verfolgen. Sehen Sie sich als Erstes die obere Menüleiste an. Klicken Sie auf die Schaltfläche „Neues Ergebnis“, um ein neues Ergebnis zu erstellen, oder auf „Neue Gruppe“ für eine neue Gruppe zum Organisieren ihrer Ergebnisse. Mit der Schaltfläche „Suchen“ können Sie Ergebnisse verwenden, die durch den Bundesstaat oder die Institution erzeugt wurden. Während Sie Ergebnisse erstellen und verwenden können Sie den Bereich auf der linken Seite nutzen, um zwischen Ihren Ergebnissen zu navigieren. Sie können Ergebnisse zwischen den verschiedenen Ebenen verschieben, um eine Struktur zu erstellen."},"el":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Ρύθμιση Αποτελεσμάτων"}}}}}},"en-AU":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"In order to import a large quantity of Outcomes at once, or to update your existing outcomes, please *follow the CSV format*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"More importantly, Canvas allows you to add outcomes to your grading rubrics so that you can evaluate mastery as you grade assignments. Once you\'ve set up outcomes, click Manage Rubrics to start using your outcomes for grading.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Setting up Outcomes"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Outcomes are created here to track mastery in a course. To get started, checkout the menu bar along the top. Click on the New Outcome button to create a new outcome, or the New Group button to create a new group to organise your outcomes into. The Find button will allow you to use outcomes that have been created by your state or institution. As you create and use outcomes you will be able to use the panel to the left to navigate through your outcomes. You can drag and drop outcomes between the different levels to create structure."},"en-CA":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"In order to import a large quantity of Outcomes at once, or to update your existing outcomes, please *follow the CSV format*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"More importantly, Canvas allows you to add outcomes to your grading rubrics so that you can evaluate mastery as you grade assignments. Once you\'ve set up outcomes, click Manage Rubrics to start using your outcomes for grading.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Setting up Outcomes"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Outcomes are created here to track mastery in a course. To get started, checkout the menu bar along the top. Click on the New Outcome button to create a new outcome, or the New Group button to create a new group to organize your outcomes into. The Find button will allow you to use outcomes that have been created by your state or institution. As you create and use outcomes you will be able to use the panel to the left to navigate through your outcomes. You can drag and drop outcomes between the different levels to create structure."},"en-GB":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"In order to import a large quantity of outcomes at once, or to update your existing outcomes, please *follow the CSV format*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"More importantly, Canvas allows you to add outcomes to your grading rubrics so that you can evaluate mastery as you grade assignments. Once you\'ve set up outcomes, click Manage Rubrics to start using your outcomes for grading.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Setting up outcomes"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Outcomes are created here to track mastery in a course. To get started, check out the menu bar along the top. Click on the New Outcome button to create a new outcome, or the New Group button to create a new group to organise your outcomes into. The Find button will allow you to use outcomes that have been created by your organisation or institution. As you create and use outcomes you will be able to use the panel to the left to navigate through your outcomes. You can drag and drop outcomes between the different levels to create structure."},"es":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Para importar una gran cantidad de resultados a la vez o para actualizar sus resultados existentes, *siga el formato CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Más importante aún, Canvas le permite agregar resultados a sus rúbricas de calificaciones para poder evaluar el dominio al calificar tareas. Una vez que ha configurado los resultados, haga clic en Administrar rúbricas para comenzar a usar sus resultados para las calificaciones.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Configurando competencias"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Aquí se crean resultados para realizar un seguimiento del dominio en un curso. Para comenzar, compruebe la barra de menú en la parte superior. Haga clic en el botón Nueva Competencia para crear una nueva competencia o el botón Nuevo grupo para crear un nuevo grupo donde organizar sus resultados. El botón Buscar le permitirá usar resultados que han sido creados por su estado o su institución. Al crear y usar resultados, podrá usar el panel a la izquierda para navegar por sus resultados. Puede arrastrar y soltar resultados entre diferentes niveles para crear una estructura."},"fa":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"راه اندازی نتایج"}}}}}},"fi":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Jos haluat tuoda suuren määrän tuloksia kerralla päivittääksesi olemassa olevia tuloksia, *käytä CSV-muotoa*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Mikä tärkeämpää, Canvasin avulla voit lisätä tuloksia arvosanojen annon rubriikkeihin, niin että voit arvioida hallintaa, kun annat tehtäville arvosanoja. Kun olet määrittänyt tulokset, aloita käyttämään tuloksia arvosanojen antoon napsauttamalla Hallitse rubriikkeja.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Tulosten määrittäminen"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Tulokset luodaan täällä hallinnan seuraamiseksi kurssilla. Jos haluat aloittaa, tarkista valikkopalkki yläosassa. Luo uusi tulos napsauttamalla Uusi tulos -painiketta tai luo uusi ryhmä organisoidaksesi tulostietoja tai Uusi ryhmä -painiketta organisoidaksesi tuloksesi. Etsi-painikkeen avulla voit käyttää tuloksia, jotka valtio tai laitoksesi on luonut. Kun luot ja käytät tuloksia, voit navigoida tuloksissa vasemmalla olevan paneelin avulla. Voit vetää ja pudottaa tuloksia eri tasojen välillä luodaksesi rakenteen."},"fr":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Afin d\'importer une grande quantité de résultats à la fois, ou de mettre à jour vos résultats existants, veuillez *suivre le format CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Plus important encore, Canvas vous permet d\'ajouter des résultats à vos barèmes afin que vous puissiez évaluer la réussite au fur et à mesure que vous évaluez les travaux. Une fois que vous avez défini les résultats, cliquez sur Gérer les barèmes pour commencer à utiliser vos résultats pour l\'évaluation.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Définition des acquis"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Les résultats sont créés ici pour suivre la réussite d\'un cours. Pour commencer, jetez un coup d\'œil à la barre de menu en haut de la page. Cliquez sur le bouton Nouveau résultat pour créer un nouveau résultat, ou sur le bouton Nouveau groupe pour créer un nouveau groupe dans lequel organiser vos résultats. Le bouton Rechercher vous permettra d\'utiliser les résultats qui ont été créés par votre État ou votre institution. Au fur et à mesure que vous créez et utilisez les résultats, vous pourrez utiliser le panneau de gauche pour naviguer à travers vos résultats. Vous pouvez glisser-déposer les résultats entre les différents niveaux pour créer une structure."},"fr-CA":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Afin d\'importer une grande quantité d’acquis à la fois, ou de mettre à jour vos acquis existants, veuillez *respecter le format CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Plus important encore, Canvas vous permet d\'ajouter des acquis à vos grilles d\'évaluation afin que vous puissiez évaluer la maîtrise au fur et à mesure que vous notez les évaluations. Une fois que vous avez défini les acquis, cliquez sur Gérer les barèmes (Manage Rubrics) pour commencer à utiliser vos acquis pour la notation.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Définition des résultats"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Les acquis sont créés ici pour effectuer le suivi de la maîtrise dans un cours. Pour commencer, jetez un coup d\'œil à la barre de menu en haut de la page. Cliquez sur le bouton Nouvel Acquis (New Outcome) pour créer un nouvel acquis, ou le bouton Nouveau groupe (New Group) pour créer un nouveau groupe pour y organiser vos acquis. Le bouton Trouver (Find) vous permettra d’utiliser les acquis créés par votre institution. Au fur et à mesure que vous créez et utilisez les acquis, vous pourrez utiliser le panneau de gauche pour naviguer à travers vos acquis. Vous pouvez glisser-déposer les résultats entre les différents niveaux pour créer une structure."},"he":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"הגדרות תוצאות למידה"}}}}}},"ht":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Pou enpòte yon gwo kantite Rezilta alafwa, oswa aktyalize rezilta aktyèl ou yo, tanpri *swiv fòma CSV a*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Sa ki pi enpòtan ankò, Canvas pèmèt ou ajoute rezilta nan ribrik notasyon ou yo pou w ka evalye metriz nòt ou yo. Depi w fin defini rezilta yo, kike sou Jere ribrik yo pou ka kòmanse itilize rezilta w yo pou klasman an.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Konfigirasyon Rezilta"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Rezilta yo kreye la a pou ka swiv metriz nan yon kou. Pou kòmanse, al gade ba meni ki pi wo a. Klike sou bouton Nouvo Rezilta a pou ka kreye yon nouvo rezilta, oswa sou bouton Nouvo Gwoup la pou ka kreye yon nouvo gwoup pou òganize rezilta w yo. Bouton Jwenn nan ap pèmèt ou itilize rezilta ke eta oswa enstitisyon ou an te kreye yo. Toutotan w ap kreye epi itilize rezilta yo, w ap kapab itilize pano agoch la pou navige nan rezilta w yo. Ou ka pran rezilta mete nan diferan nivo pou ka kreye estrikti."},"hu":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Tanulási eredmények beállítása"}}}}}},"hy":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Գնահատականների տեղադրում"}}}}}},"is":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Til að flytja inn mikið magn af niðurstöðum í einu, eða til að uppfæra fyrri niðurstöður þínar, vinsamlegast *farður eftir CSV sniðinu*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Það sem meira er um vert, Canvas gerir þér fært um að bæta útkomum við einkunnargjöfina þannig að þú getir hæfnismetið um leið og þú gefur verkefnum einkunnir. Þegar þú hefur sett upp útkomurnar, smelltu á Manage Rubrics til að nota útkomur þínar til að gefa einkunnir.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Set upp niðurstöður"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Útkomur eru skapaðar hér til að rekja hæfni á námskeiði. Til að byrja, athugið valmyndastikuna efst. Smelltu á nýja útkomu hnappinn til að búa til nýja útkomu, eða nýjan hóp hnappinn til að búa til nýjan hóp til að skipuleggja útkomurnar inn í.   Finna hnappurinn gerir þér kleift að nota útkomur sem hafa verið gerðar af ríki eða stofnunum. Þegar þú býrð til útkomur getur þú notað töfluna til vinstri til að skoða í gegnum þínar útkomur.  Þú getur dregið og sleppt útkomur milli mismunandi stiga til að búa til skipulag."},"it":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Per importare più esiti contemporaneamente o aggiornare gli esiti esistenti, *segui il formato CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Ancora più importante, Canvas ti consente di aggiungere gli esiti alle tue rubriche di valutazione, così puoi valutare il livello di padronanza durante l\'assegnazione di voti ai compiti. Una volta impostati gli esiti, fai clic su Gestisci rubriche per iniziare a utilizzare i tuoi esiti per la valutazione.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Impostazione degli esiti"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Gli esiti vengono creati qui per tenere traccia del livello di padronanza in un corso. Per iniziare, dai un\'occhiata alla barra dei menu nella parte superiore. Fai clic sul pulsante Nuovo esito per creare un nuovo esito o sul pulsante Nuovo gruppo per creare un nuovo gruppo in cui organizzare i tuoi esiti. Il pulsante Trova ti consentirà di utilizzare gli esiti creati in base al tuo stato o istituto. Durante la creazione e l\'utilizzo degli esiti, potrai spostarti tra i tuoi esiti mediante il pannello a sinistra. Puoi trascinare gli esiti tra i diversi livelli per creare la struttura."},"ja":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"一度に大量の成果をインポートする、または既存の成果を更新するには、*CSV形式に従ってください*。","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"さらに重要なことに、Canvas では成績表に成果を追加できるため、成績を評価する際に習得を評価することができます。成果を設定したら、[ルーブリックスの管理]をクリックして、成果の採点への使用を開始します。","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"成果の設定"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"コースの習得を追跡するため、ここに成果が作成されます。上部にあるメニューバーをチェックアウトして開始します。新しい成果を作成するには、「新しい成果」ボタンをクリックするか、または成果を振り当てる新しいグループを作成するには「新しいグループ」ボタンをクリックしてください。[Find]（検索）ボタンを使用すると、あなたの州または機関によって作成された結果を使用することができます。成果を作成して使用する際には、左側のパネルを使用して成果をナビゲートすることができます。成果をさまざまなレベル間でドラッグアンドドロップして構造を作成することができます。"},"ko":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"성과 설정하기"}}}}}},"mi":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Ki te kawemai i te nui o ngā Putanga i te wā kotahi, ki te whakahou rānei i ō putanga o naianei, tēnā koa * whai i te hōputu CSV *.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Ko te mea nui atu, ka taea e Canvas te whakauru i ngā putanga ki ō raupapa kaute kia taea ai e koe te aromatawai ngā kōeke whakataunga. I te wā kua whakaritea e koe ngā putanga, pawhiria te Whakahaere Rarai hei timata ki te whakamahi i ō putanga mo te kōeke.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Te whakatu Putanga"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Ka waihangahia ngā putanga ki konei ki te aroturuki i te mahinga i roto i te akoranga. Ki te timata, āta titirotia te tahua papa i runga. Pāwhiria te pātene Putanga Hou hei waihanga i tētahi putanga hou, ki te pātene Rōpū Hou rānei hei waihanga i tētahi rōpū hou hei whakarite i ō hua ki roto. Ka tukua koe e te pātene Kimi ki te whakamahi i ngā putanga i hangaia e tō kāwanatanga, whakanōhanga rānei. I a koe e hanga ana me te whakamahi i ngā putanga ka taea e koe te whakamahi i te rōpū ki te taha maui ki te whakatere i roto i ō putanga. Ka taea e koe te tō me te whakataka i ngā putanga i waenganui i ngā taumata rerekē hei hanga hanganga."},"nb":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"For å kunne importere en stor mengde resultater samtidig, eller oppdatere eksisterende resultater, *følg CSV-formatet*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Ikke minst, lar Canvas deg legge til resultater i karakterrubrikkene dine, slik at du kan vurdere læringsmål mens du karaktersetter oppgaver. Når du har satt opp resultater, klikk på Behandle rubrikker for å bruke resultater for karaktersetting.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Sette opp læringsmål"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Resultater opprettes her for å spore læringsmål i et emne. For å komme i gang, se menylinjen langs toppen. Klikk på Nytt resultat for å opprette et nytt resultat, eller Ny gruppe for å opprette en ny gruppe der du kan organisere resultater. Finn-knappen lar deg bruke resultater som allerede har blitt opprettet i institusjonen. Ettersom du oppretter og bruker resultater kan du bruke panelet til venstre å navigere gjennom resultater. Du kan dra og slippe resultater mellom de forskjellige nivåene for å lage en struktur."},"nb-x-k12":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"*Bruk CSV-formatet* for å importere eller oppdatere en stor mengde mål samtidig.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Ikke minst, lar Canvas deg legge til resultater i vurderingskriteriene dine, slik at du kan vurdere mål mens du vurderer oppgaver. Når du har satt opp resultater, klikk på Behandle vurderingskriterier for å bruke resultater for vurdering.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Sette opp mål"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Mål opprettes her for å spore måloppnåelse i et fag. For å komme i gang, se menylinjen langs toppen. Klikk på Nytt mål-knappen for å opprette et nytt mål, eller Ny gruppe for å opprette en ny gruppe der du kan organisere resultater. Finn-knappen lar deg hente mål som allerede er opprettet av institusjonen din. Når du oppretter og bruker mål, finner du dem i panelet til venstre. Du kan dra og slippe målene mellom de ulike nivåene for å lage en struktur."},"nl":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"*Maak gebruik van de CSV-indeling* om in één keer een grote hoeveelheid leerdoelen te importeren of om je bestaande leerdoelen bij te werken.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Het belangrijkste is dat je met Canvas leerdoelen  aan je beoordelingsrubrieken kunt toevoegen zodat je de resultaten kunt evalueren bij het beoordelen van opdrachten. Nadat je leerdoelen hebt ingesteld, klik je op Rubrieken beheren (Manage Rubrics) om deze leerdoelen te gebruiken bij beoordelingen.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Leerdoelen instellen"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Leerdoelen worden hier gemaakt om de voortgang in een cursus bij te houden. Bekijk de menubalk bovenaan om aan de slag te gaan. Klik op de knop Nieuw leerdoel (New Outcome) om een nieuw leerdoel te maken, of op de knop Nieuwe groep (New Group) om een nieuwe groep te maken om daar je leerdoelen in te zetten. Met de knop Zoeken (Find) kun je leerdoelen gebruiken die door je organisatie zijn opgesteld. Bij het opstellen en gebruiken van leerdoelen kun je het deelvenster links gebruiken om je leerdoelen te doorlopen. Je kunt leerdoelen van het ene naar het andere niveau slepen om structuur aan te brengen."},"nn":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"For å importere eit stort tal læringsmål på ein gong, eller oppdatere gjeldande læringsmål, *bruk CSV-format*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Viktigare er det at Canvas tillet ein brukar å legge til læringsmål til vurderingsskjema og -kriterium sånn at  meistring kan vurderast undervegs. Når læringsmål er sett opp, klikk på knappen administrer vurderingsskjema og bruk læringsmåla du laga når du vurderer oppgåver.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Registrer læringsmål"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Læringsmål er oppretta her for å følgje meistringsnivå i eit emne. For å komme i gang, sjå menyrad langs toppen. Klikk på knappen Nytt læringsmål for å opprette eit nytt læringsmål, eller på knappen Ny gruppe for å opprette ei ny gruppe der læringsmål kan organiserast. Finn-knappen gir deg moglegheit til å bruke læringsmål som er oppretta for institusjonen. Når du oppretter og brukar læringsmål kan du bruke panelet til venstre til å navigere gjennom alle læringsmåla dine. Du kan dra og slippe læringsmål på tvers av nivå og slik opprette ein struktur. "},"pl":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Aby zaimportować dużą liczbę wyników na raz lub zaktualizować istniejące wyniki, należy *użyć formatu CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Co jeszcze ważniejsze, Canvas pozwala dodawać wyniki do rubryk ocen, tak aby szacować opanowanie materiału podczas oceniania zadań. Po przygotowaniu wyników kliknij pozycję Zarządzaj rubrykami, aby rozpocząć korzystanie z wyników do wystawiania ocen.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Ustawianie wyników"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Wyniki są tworzone w celu śledzenia stopnia opanowania materiału zwartego w kursie. Aby rozpocząć pracę, zapoznaj się z paskiem menu na górze. Kliknij przycisk Nowy wynik, aby utworzyć nowy wynik, lub przycisk Nowa grupa, aby utworzyć nową grupę i uporządkować swoje wyniki. Za pomocą przycisku Znajdź można używać wyników utworzonych przez instytucję lub urząd. Oprócz tworzenia i używania wyników można także korzystać z panelu po lewej stronie, który służy do nawigowania po wynikach. Przeciągając i upuszczając wyniki na różnych poziomach, można tworzyć struktury."},"pt":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Para importar uma grande quantidade de resultados ao mesmo tempo, ou para atualizar os resultados existentes, *siga o formato CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Mais importante ainda, o Canvas permite que você adicione resultados às suas rubricas de classificação para que você possa avaliar o domínio como você classifica as atribuições. Depois de configurar os resultados, clique em Gerir rubricas para começar a usar seus resultados para classificação.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Configurar resultados"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Os resultados são criados aqui para rastrear o domínio em uma disciplina. Para começar, marque a barra de menu no topo. Clique no botão Novo Resultado para criar um novo resultado ou no botão Novo Grupo para criar um novo grupo para organizar seus resultados. O botão Localizar permitirá que você use os resultados que foram criados pelo seu estado ou instituição. À medida que você cria e usa resultados, você poderá usar o painel à esquerda para navegar pelos seus resultados. Você pode arrastar e largar resultados entre os diferentes níveis para criar a estrutura."},"pt-BR":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Para importar uma grande quantidade de Objetivos de uma vez, ou atualizar os seus objetivos existentes, *siga o formato CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Principalmente, o Canvas permite que você adicione objetivos às suas rubricas de avaliação para que você possa avaliar o domínio como você avalia as tarefas. Quando tiver configurado os objetivos, clique em Gerenciar Rubricas para começar a usar os seus objetivos para avaliação.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Configurando objetivos"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Objetivos são criados aqui para acompanhar domínio em um curso. Para começar, veja a barra de menu no topo. Clique no botão Novo objetivo para criar um novo objetivo, ou o botão Novo grupo para criar um grupo novo para organizar os seus objetivos. O botão Encontrar permitirá que você use os objetivos criados pela sua instituição ou estado. Ao criar e usar objetivos, você poderá usar o painel à esquerda para navegar pelos objetivos. Você pode arrastar e soltar objetivos entre os diferentes níveis para criar estrutura."},"ru":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Чтобы сразу импортировать большое количество результатов или обновить ваши существующие результаты, *следуйте формату CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Что еще более важно, Canvas позволяет добавлять результаты в ваши рубрики выставления оценок, чтобы вы могли оценивать усвоение по мере того, как вы оцениваете задания. После того, как вы настроили результаты, нажмите «Управление рубриками», чтобы начать использовать результаты для выставления оценок.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Установка результатов"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Результаты создаются здесь для отслеживания усвоения по ходу курса. Чтобы начать, проверьте строку меню вверху. Нажмите кнопку «Новый результат», чтобы создать новый результат, или кнопку «Новая группа», чтобы создать новую группу для упорядочивания ваших результатов. Кнопка «Найти» позволит вам использовать результаты, созданные вашим государственным органом или учебным заведением. Когда вы создаете и используете результаты, вы сможете использовать панель слева для просмотра своих результатов. Вы можете перетаскивать результаты между различными уровнями для создания структуры."},"sl":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Če želite uvoziti veliko količino učnih izidov hkrati ali posodobiti obstoječe učne izide, upoštevajte *obliko zapisa CSV*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Še pomembneje je, da sistem Canvas omogoča dodajanje učnih izidov v ocenjevalne vodnike, ki jih uporabljate pri ocenjevanju, tako da lahko med ocenjevanjem nalog ovrednotite odličnost. Da boste lahko začeli uporabljati učne izide za ocenjevanje, kliknite »Uredi ocenjevalne vodnike«, ko nastavite učne izide.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Nastavitev učnih izidov"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Učni izidi so tu ustvarjeni za sledenje odličnosti pri predmetu. Da boste lahko začeli, si oglejte menijsko vrstico na vrhu. Za ustvarjanje novega izida kliknite gumb Nov izid, za ustvarjanje nove skupine, v katero boste organizirali učne izide, pa gumb Nova skupina. Z gumbom Najdi boste lahko uporabili učne izide, ki jih je ustvarila vaša država ali ustanova. Med ustvarjanjem in uporabo učnih izidov boste lahko navigirali po učnih izidih prek plošče na levi. Da ustvarite strukturo, lahko učne izide vlečete in spuščate med različnimi ravnmi."},"sv":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"För att importera en stor mängd lärandemål på en gång, eller för att uppdatera dina befintliga lärandemål, *använd dig av CSV-formatet*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Canvas gör det dessutom möjligt för dig att lägga till lärandemål i dina bedömningsmatriser så att du kan utvärdera måluppfyllelse när du bedömer uppgifter. När du har ställt in dina lärandemål klickar du på Hantera matriser för att börja använda dem för bedömning.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Ställa in lärandemål"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Här kan du skapa lärandemål som tillåter dig att spåra måluppfyllelse i en kurs. För att komma igång, se menyfältet längst upp. Klicka på knappen Nytt lärandemål för att skapa ett nytt lärandemål, eller på knappen Ny grupp för att skapa en ny grupp att organisera dina lärandemål i. Sök-knappen gör det möjligt för dig att använda lärandemål som har skapats av ditt lärosäte eller din institution. När du skapar och använder lärandemål kan du använda panelen till vänster för att navigera genom dina lärandemål. Du kan organisera dina lärandemål genom att organisera dem mellan de olika nivåerna."},"sv-x-k12":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"För att importera en stor mängd lärandemål på en gång, eller för att uppdatera dina befintliga lärandemål, *använd dig av CSV-formatet*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Canvas gör det dessutom möjligt för dig att lägga till lärandemål i dina bedömningsmatriser så att du kan utvärdera måluppfyllelse när du bedömer uppgifter. När du har ställt in dina lärandemål klickar du på Hantera matriser för att börja använda dem för bedömning.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Ställa in lärandemål"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Här kan du skapa lärandemål som tillåter dig att spåra måluppfyllelse i en kurs. För att komma igång, se menyfältet längst upp. Klicka på knappen Nytt lärandemål för att skapa ett nytt lärandemål, eller på knappen Ny grupp för att skapa en ny grupp att organisera dina lärandemål i. Sök-knappen gör det möjligt för dig att använda lärandemål som har skapats av ditt lärosäte eller din institution. När du skapar och använder lärandemål kan du använda panelen till vänster för att navigera genom dina lärandemål. Du kan organisera dina lärandemål genom att organisera dem mellan de olika nivåerna."},"tr":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"Çok sayıda Öğrenme Çıktısını bir kerede içe aktarmak veya mevcut öğrenme çıktılarınızı güncellemek için lütfen *buradaki CSV biçimine bakın*.","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"Daha da önemlisi, Canvas, ödevleri derecelendirirken yeterliliği değerlendirebilmeniz için notlandırmada kullanılan değerlendirme listelerinize öğrenme çıktıları eklemenizi sağlar. Öğrenme çıktılarını ayarladıktan sonra, bu çıktıları notlandırmada kullanmaya başlamak için Değerlendirme Listelerini Yönet\'i tıklayın.","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Öğrenme Çıktılarını Ayarlama"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"Öğrenme çıktıları bir derste yeterliliği izlemek için oluşturulur. Başlangıç olarak en üstteki menü çubuğunu kontrol edin. yeni bir öğrenme çıktısı oluşturmak için Öğrenme çıktısını butonuna tıklayın ya da öğrenme çıktılarınızı içinde düzenleyebileceğiniz yeni bir grup oluşturmak için Yeni Grup butonuna tıklayın. Bul butonu ile kurumunuz tarafından oluşturulmuş öğrenme çıktılarını kullanabilirsiniz. Öğrenme çıktılarını oluşturup kullanmaya başladıkça bu çıktılarınızı soldaki gezinme menüsünden seçip kullanabileceksiniz. Bir yapı oluşturmak için öğrenme çıktılarını farklı seviyelerde sürükleyip bırakabilirsiniz. "},"uk":{"outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"Налаштування результатів"}}}}}},"zh-Hans":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"要一次性导入大量结果，或更新现有结果，请*使用CSV格式*。","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"更重要的是，Canvas允许您将结果添加到评分评价量规中，以便在您给作业评分时评估掌握程度。设置好结果后，单击Manage Rubrics(管理评价量规)可以开始使用要评分的结果。","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"设置结果"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"在此处创建结果以跟踪课程掌握程度。要开始使用，请查看顶部的菜单栏。单击New Outcome(新结果)按钮可创建新结果，或单击New Group(新组)按钮可创建新组，以整理您的结果。使用Find(查找)按钮可使用您所在的州或机构创建的结果。在您创建和使用结果时，您可以使用左侧面板在结果中导航。您可以将结果拖放到不同级别，以创建结构。"},"zh-Hant":{"in_order_to_import_a_large_quantity_of_outcomes_at_c0d587e3":"為了一次性匯入大量學習成果，或更新您現有的學習成果，請*遵循 CSV 格式*。","more_importantly_canvas_allows_you_to_add_outcomes_78822cf":"更重要的是，Canvas 允許您將學習成果添加到您的評分標準中，以便您在評分作業時評估掌握程度。設定好學習成果後，點擊「管理評分標準」以開始使用學習成果進行等級評分。","outcomes":{"main_instructions":{"instructions":{"main":{"manage":{"title":"設置成果"}}}}},"outcomes_are_created_here_to_track_mastery_in_a_co_2f487549":"在此創建學習成果以跟踪課程的掌握程度。要開始，請檢查頂部的選單欄。點擊「新學習成果」按鈕以創建一個新的學習成果，或者點擊「新群組」按鈕以創建一個新群組，以便將學習成果組織到其中。「尋找」按鈕將允許您使用透過您的國家或機構創建的學習成果。在創建和使用學習成果時，您可以使用左側的面板瀏覽學習成果。您可以在不同級別之間拖放學習成果以創建結構。"}}'))
